let correctness = this.state.correct //I'm not sure if the while condition will work without a variable, so I assigned the correct value to a variable.
while (this.parameters.id == "Go"){
  if(this.state.response_action == keydown(Space)) {
    correctness == true
  } else {
    correctness == false
  }
}
while(this.parameters.id == "NoGo"){
  if(this.state.response_action == keydown(Space)) {
    correctness == false
  } else {
    correctness == true
  }
}
